data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1644992","type":"CustomJS"},{"attributes":{"format":"0.[00]%"},"id":"1644876","type":"NumeralTickFormatter"},{"attributes":{"coordinates":null,"data_source":{"id":"1644752"},"glyph":{"id":"1644753"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1644755"},"nonselection_glyph":{"id":"1644754"},"view":{"id":"1644757"}},"id":"1644756","type":"GlyphRenderer"},{"attributes":{},"id":"1644956","type":"BasicTickFormatter"},{"attributes":{},"id":"1644663","type":"SaveTool"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"1644698","type":"WheelZoomTool"},{"attributes":{"axis":{"id":"1644689"},"coordinates":null,"group":null,"ticker":null},"id":"1644692","type":"Grid"},{"attributes":{"children":[[{"id":"1644681"},0,0],[{"id":"1644827"},1,0],[{"id":"1644641"},2,0],[{"id":"1644878"},3,0]]},"id":"1645063","type":"GridBox"},{"attributes":{"coordinates":null,"data_source":{"id":"1644921"},"glyph":{"id":"1644923"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1644925"},"nonselection_glyph":{"id":"1644924"},"view":{"id":"1644927"}},"id":"1644926","type":"GlyphRenderer"},{"attributes":{"coordinates":null,"data_source":{"id":"1644673"},"glyph":{"id":"1644936"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1644938"},"nonselection_glyph":{"id":"1644937"},"view":{"id":"1644940"}},"id":"1644939","type":"GlyphRenderer"},{"attributes":{"coordinates":null,"data_source":{"id":"1644673"},"glyph":{"id":"1644912"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1644914"},"nonselection_glyph":{"id":"1644913"},"view":{"id":"1644916"}},"id":"164491
